    \ All subsequent reports that are affected by this correction will be amended.
    \ 2) Please be advised that an amended report is being filed to clarify the discrepancy
    of the beginning cash balance of this report.  The beginning cash balance of this
    report did not equal the ending balance on our Amended October Monthly Report
    (9/1/08-9/30/08), received 12/8/08, because this report was filed on 10/23/08
    before the Amended October Monthly Report was filed.  3) Relative to Schedule
    A supporting Line 15, the $1,875 from 'New York County Democratic Committee' is
    paid rent for office space.  Previous payments from the New York County Democratic
    Committee were reported as such on previous reports.  4) The nature of the transfers-in
    from 'Democratic Congressional Campaign Committee' is support for federal races.
    \ Payment for 'Lapel Stickers & Yard Signs' was not made from transfers-in from
    the national committee to specifically fund the activity.  Campaign materials
    were paid from State Party federal funds and distributed by volunteers during
    the general election.  5) Relative to Schedule H4, please note that the report
    is being amended to provide correct allocated activity or event year-to-date totals
    for the Administrative category.  6) Relative to Schedule H4, please note the
    following description: 'General Consulting Non-Candidate Specific' is being corrected
    on the amended report.  7) Please be advised that an amended report is being filed
